import { Center, Text, VStack,   RangeSlider, RangeSliderTrack, RangeSliderFilledTrack, RangeSliderThumb, } from '@chakra-ui/react';

function Slider () {
  return(
    <RangeSlider aria-label={['min', 'max']} defaultValue={[1, 1000]}>
      <RangeSliderTrack>
        <RangeSliderFilledTrack />
      </RangeSliderTrack>
      <RangeSliderThumb index={0} />
      <RangeSliderThumb index={1} />
    </RangeSlider>
  )
}

const Question1 = (): JSX.Element => (
  <div>
    <Center mt="64px">
      <VStack spacing="32px">
        <Text fontSize='4xl'>IBV</Text>
      </VStack>
      <Slider/>
    </Center>
  </div>
);
export default Question1;
